GleaM does not have a built-in error handling mechanism. Therefore, if you try to use a function or variable that is not annotated with the correct type, it will cause a compilation error. Here are some common types of errors that can occur:

1. Type mismatch: If the function or variable's argument and return type do not match, Glema will throw a compile-time error. For example:

```glama
function add(a: int, b: int): int {
    return a + b;
}

var result = add(10, 20); // Error: Expected 'int', found 'float'
```

2. Undefined variable: If the function or variable is not defined in your program, Glema will throw a compile-time error. For example:

```glama
function get_name(): string {
    return "John";
}

var name = get_name(); // Error: 'get_name' is undefined
```

3. Invalid argument: If the function or variable takes an invalid type as its argument, Glema will throw a compile-time error. For example:

```glama
function multiply(a: int, b: float): int {
    return a * b;
}

var result = multiply(10, 20); // Error: Expected 'int', found 'float'
```

4. Invalid return type: If the function or variable returns an invalid type as its return value, Glema will throw a compile-time error. For example:

```glama
function get_name(): string {
    return "John";
}

var name = get_name(); // Error: 'get_name' is not a valid function return type
```
